import React, { useEffect, useState } from "react";
import { Routes, Route, useNavigate } from "react-router-dom";
import Layout from "./Layout";
import Profile from "./Profile";
import { fetchDashboardData } from "../services/api";

const DoctorDashboard = () => {
  const [welcomeMessage, setWelcomeMessage] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    const getData = async () => {
      try {
        const data = await fetchDashboardData("doctor");
        setWelcomeMessage(data.message || "Welcome to the Doctor Dashboard!");
      } catch (error) {
        console.error("Error fetching dashboard data:", error);
      }
    };
    getData();
  }, []);

  const menuItems = [
    { name: "Profile", path: "/dashboard/doctor/profile" },
    { name: "Update", path: "/dashboard/doctor/update" },
    { name: "Notifications", path: "/dashboard/doctor/notifications" },
    { name: "Chat", path: "/dashboard/doctor/chat" },
    { name: "Appointments", path: "/dashboard/doctor/appointments" },
    { name: "Settings", path: "/dashboard/doctor/settings" },
  ];

  return (
    <Layout
      menuItems={menuItems}
      onMenuClick={(path) => navigate(path)}
    >
      <Routes>
        <Route
          path="/dashboard/doctor"
          element={<h1>{welcomeMessage}</h1>}
        />
        <Route path="/dashboard/doctor/profile" element={<Profile />} />
        <Route
          path="/dashboard/doctor/update"
          element={<div>Update Page - Coming Soon</div>}
        />
        <Route
          path="/dashboard/doctor/notifications"
          element={<div>Notifications Page - Coming Soon</div>}
        />
        <Route
          path="/dashboard/doctor/chat"
          element={<div>Chat Page - Coming Soon</div>}
        />
        <Route
          path="/dashboard/doctor/appointments"
          element={<div>Appointments Page - Coming Soon</div>}
        />
        <Route
          path="/dashboard/doctor/settings"
          element={<div>Settings Page - Coming Soon</div>}
        />
      </Routes>
    </Layout>
  );
};

export default DoctorDashboard;
